// import { useState, useEffect } from 'react'
import './App.css';


function getExp(stlvl,endlvl,type){
  fetch('/exp/'+stlvl+'/'+endlvl+'/'+type)
  .then(response => response.json())
  .then(data => console.log(data));
}

function App() {

  return (
    <div className="App">

      <input type="number" id="stlvl"></input>
      <input type="number" id="endlvl"></input>

      <select id="type">
        <option value="NONE">NONE</option>
        <option value="MEGA">MEGA</option>
        <option value="TERA">TERA</option>
        <option value="HYPER">HYPER</option>
      </select>
      <button onClick={getExp(document.getElementById('stlvl').value,document.getElementById('endlvl').value,document.getElementById('type').value)}> Get Exp </button>
    </div>
  );
}

export default App;
